import styled from 'styled-components';

export const LinkingWrapper = styled.div`
ul {
    list-style-type:none;
    display: flex;
    align-items: center;
    justify-content: center;
    margin: 0;
}
li {
    display: flex;
    position: relative;
    font-size: 12px;
    a {
        text-decoration: none;
        color: black;
    }
}
.aaa {
  display: flex;
  align-items: center;
}
  .nav_menu {
    display: flex;
    justify-content: space-around;
  }
`
